import React, { useEffect } from "react";

const SvgWrapper = ({ src, ...rest }) => {
  useEffect(() => {
    console.log("name", src);
  }, []);

  const svgPath = require(`../../assest/${src}.svg`).default;

  return <img src={svgPath} alt={src} {...rest} />;
};

export default SvgWrapper;
